import React from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import PublicIcon from '@mui/icons-material/Public';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';
import { createTheme, ThemeProvider } from '@mui/material/styles';

function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const cards = [
  // ... your card data ...
];

const defaultTheme = createTheme();

export default function Web() {
  const scrollToCards = () => {
    const cardsSection = document.getElementById('cards');
    cardsSection.scrollIntoView({ behavior: 'smooth' });
  };

  const scrollToQuiz = () => {
    const quizSection = document.getElementById('quiz');
    quizSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <ThemeProvider theme={defaultTheme}>
      <CssBaseline />
      <AppBar position="relative">
        <Toolbar>
          <PublicIcon sx={{ mr: 2 }} />
          <Typography variant="h6" color="inherit" noWrap>
            climate.talk
          </Typography>
        </Toolbar>
      </AppBar>
      <main>
        <Box
          sx={{
            bgcolor: 'background.paper',
            pt: 8,
            pb: 6,
          }}
        >
          <Container maxWidth="lg">
            <Typography
              component="h1"
              variant="h2"
              align="center"
              color="text.primary"
              gutterBottom
            >
              climate change infos
            </Typography>
            <Typography variant="h5" align="center" color="text.secondary" paragraph>
              Bienvenue sur notre site dédié au changement climatique. Nous vous fournissons des informations précises sur les causes et les impacts du changement climatique, tout en démystifiant les idées fausses. Explorez nos ressources pour une compréhension éclairée et des actions concrètes en faveur d'un avenir durable.
            </Typography>
            <Stack
              sx={{ pt: 4 }}
              direction="row"
              spacing={2}
              justifyContent="center"
            >
              <Button variant="contained" onClick={scrollToCards}>
                Découvrir le climat.
              </Button>
              <Button variant="outlined" onClick={scrollToQuiz}>
                Essayez notre quiz.
              </Button>
            </Stack>
          </Container>
        </Box>
        <Container sx={{ py: 8 }} maxWidth="md" id="cards">
          <Grid container spacing={4} maxWidth="lg">
            {cards.map((card, index) => (
              <Grid item key={index} xs={12} sm={6} md={6}>
                <Card
                  sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}
                >
                  <CardMedia
                    component="div"
                    sx={{
                      pt: '56.25%',
                    }}
                    image={card.image}
                  />
                  <CardContent sx={{ flexGrow: 1 }}>
                    <Typography gutterBottom variant="h5" component="h2">
                      {card.title}
                    </Typography>
                    <Typography>
                      {card.description}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
        <Typography
          variant="h4"
          sx={{ width: '50%' }}
          position={'relative'}
          ml="350px"
          id="quiz"
        >
          idées fausses courantes sur le changement climatique et leurs corrections
        </Typography>
        {/* ... your quiz content ... */}
      </main>
    </ThemeProvider>
  );
}
